script: |
  super -f text -I q6445.spq | sort > q6445.out

inputs:
  - name: q6445.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE NOT col0 IN ( - col1 * - - col1, - col0, - - col1, - col2, + 11 + - - col0, - 38 );
  - name: tab1

outputs:
  - name: q6445.out
    data: |
      51	14	96
      85	5	59
      91	47	68
